mapper.select:
select WF_ID AS wfId, CASE_ID AS caseId, CASE_TYPE AS caseType, CASE_SUBJECT AS caseSubject, CASE_DESC AS caseDesc,
CREATION_TIME AS creationTime, IS_VIP AS isVip, YOUYOU_USERNAME AS youyouUsername, WF_STATUS AS wfStatus, WX_ID AS wxId
from VIP_QUEUE
WHERE CITY_ID = #{param.cityId} AND ERP_COMP_ID = #{param.compId}

  AND CASE_TYPE=#{param.caseType}


  AND CREATION_TIME >= #{param.startTime}


  AND CREATION_TIME < #{param.endTime}


  AND IS_VIP = #{param.isVip}

ORDER BY CREATION_TIME DESC
